import Task from './Task'
const Tasks = ({tasks , onDelete , onToggle ,index}) => { 

    

        return (
            <>
            {tasks.map((task)=>(
                // <h3>{task.text}</h3>

                <Task 
                key={index}
                task={task}
                onDelete={onDelete}
                onToggle={onToggle}
                />

                
               
                ))} 
            </>
        )
    }


export default Tasks
